// src/components/Home.js
import React from 'react';
import ImageSlider from './ImageSlider';
import About from './About';
import Projects from './Projects';
import Skills from './Skills';
import Contact from './Contact';
import "./Home.css"

const Home = () => {
  return (
    <div>
      {/* Slider Section */}
      <section className="slider-section">
        <ImageSlider />
      </section>

      {/* About Section */}
      <section id="about">
        <About />
      </section>

      {/* Projects Section */}
      <section id="projects">
        <Projects />
      </section>

      {/* Skills Section */}
      <section id="skills">
        <Skills />
      </section>

      {/* Contact Section */}
      <section id="contact">
        <Contact />
      </section>
    </div>
  );
};

export default Home;
